import './web_footer.css';
import { ReactComponent as linkedIn } from './logo/linkedin.svg';
import { ReactComponent as mail } from './logo/mail.svg';
import { ReactComponent as github } from './logo/github.svg';

function web_footer() {
    return(
        <div id="footer">
            <div id="footer_socials">
                <div id="linkedIn"><a href="https://www.linkedin.com/in/william-ramsay-b2b45617b">linkedin</a></div>
                <div id="github"><a href="https://github.com/Virulentis">github</a></div>
                <div id="email"><a href="mailto:WilliamWRamsay@yahoo.com">mail</a></div>
            </div>
        </div>
    )


}
export default web_footer
